import React from 'react';
import GlobalMap from './GlobalMap';
import './App.css'; // Optional: Add general styling for the app

const App = () => {
    return (
        <div className="App">
            <h1>Interactive Map with Popup Cards</h1>
            <GlobalMap />
        </div>
    );
};

export default App;
